import React, { Component } from 'react'
import { chefOfTheWeek } from '../../../interfaces/Chef'
import './temp.css'
import Slider from "react-slick";
import { render } from 'react-dom';
import { TitleC } from './StyleChefDetails';
export default class ChefRestaurants extends Component  {
/*  return (
    <div className='rests'>
        {chefOfTheWeek.restaurants.map((restaurant)=>(
           <div> 
            <p><img src={restaurant.resImgUrl} alt=''/> </p>
            <p> {restaurant.name}</p>
            </div>))}

    </div>
  )
}*/
render() {
    const settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 3,
      slidesToScroll: 3
    };
    return (
      <div>
        <TitleC> Restaurants Of the Chef: </TitleC> 
        <Slider {...settings}>
        {chefOfTheWeek.restaurants.map((restaurant)=>(
           <div> 
            <p><img src={restaurant.resImgUrl} alt=''/> </p>
            <p> {restaurant.name}</p>
            </div>))}
        </Slider>
      </div>
    );
  }
}
